import React from "react";
import "./MovieList.css";
import "./Row.css";

function MovieList(props) {
  return (
    <div className="row">
      <div className="row_posters">
        {props.movies.map((movie, index) => (
          <img
            className="row_posterLarge"
            src={movie.Poster}
            alt={movie.name}
          />
        ))}
      </div>
    </div>
  );
}

export default MovieList;
